import React from "react";
import { Link } from "react-router-dom";
import "../App.css";
import SideBar from "./SideBar";

const Main = (props) => {
  const onClick = () => {
    console.log("clicked");
  };

  return (
    <>
      <div>
        <img src="images/map.jpg"></img>
      </div>
      <button className="side_btn" onClick={onClick}>
        <img src="images/button.png"></img>
      </button>
      <SideBar></SideBar>
    </>
  );
};

export default Main;
